const KNOWN_COMPANIES = {
  "apple": { name: "Apple", context: "Apple products, iPhone, iPad, Mac, iOS, macOS" },
  "google": { name: "Google", context: "Google products, Android, Chrome, Search, Pixel" },
  "openai": { name: "OpenAI", context: "OpenAI, ChatGPT, GPT models, AI assistants" },
  "chatgpt": { name: "OpenAI", context: "OpenAI ChatGPT, AI chatbot interface" },
  "anthropic": { name: "Anthropic", context: "Anthropic, Claude AI, AI safety" },
  "claude": { name: "Anthropic", context: "Anthropic Claude, AI assistant" },
  "meta": { name: "Meta", context: "Meta, Facebook, Instagram, WhatsApp, Llama AI" },
  "microsoft": { name: "Microsoft", context: "Microsoft, Windows, Azure, Copilot, Office" },
  "nvidia": { name: "NVIDIA", context: "NVIDIA, GPUs, CUDA, AI chips" },
  "tesla": { name: "Tesla", context: "Tesla, electric vehicles, Elon Musk, self-driving" },
  "amazon": { name: "Amazon", context: "Amazon, AWS, Alexa, cloud computing" },
  "samsung": { name: "Samsung", context: "Samsung, Galaxy phones, semiconductors" },
  "tiktok": { name: "TikTok", context: "TikTok, ByteDance, short video, social media" },
  "trump": { name: "Trump Administration", context: "US politics, tech regulation, executive orders" }
};

const title = $input.first().json.title.toLowerCase();
let detectedCompany = null;
let companyContext = null;

for (const [keyword, info] of Object.entries(KNOWN_COMPANIES)) {
  if (title.includes(keyword)) {
    detectedCompany = info.name;
    companyContext = info.context;
    break;
  }
}

return [{
  json: {
    ...$input.first().json,
    detectedCompany,
    companyContext,
    skipImage: $input.first().json.templateType === "meme"
  }
}];

const data = $input.first().json;
let imagePrompt;

if (data.detectedCompany) {
  imagePrompt = `Create a modern, professional blog header image (16:9 aspect ratio, 1200x675px) about: "${data.title}". The image should visually reference ${data.detectedCompany} (${data.companyContext}). Style: clean tech blog aesthetic, subtle gradients, modern typography feel. No text in the image.`;
} else {
  const categoryThemes = {
    "vpn-privacy": "digital privacy, shield icons, encrypted data streams, lock symbols",
    "ai-launches": "artificial intelligence, neural networks, futuristic tech, glowing circuits",
    "ai-regulation": "law and technology, gavels with circuit boards, regulation documents",
    "big-tech": "corporate tech, glass buildings, data centers, modern office",
    "us-policy": "government and technology, Capitol building with tech overlay",
    "censorship": "internet freedom, broken chains, firewall visualization",
    "cybersecurity": "cybersecurity, hacking, digital threats, shields and code",
    "streaming": "streaming media, entertainment, screens and content",
    "startup-vc": "startup ecosystem, venture capital, growth charts, innovation"
  };

  const theme = categoryThemes[data.topicCategory] || "modern technology, digital innovation";
  imagePrompt = `Create a modern, professional blog header image (16:9 aspect ratio, 1200x675px) about: "${data.title}". Visual theme: ${theme}. Style: clean tech blog aesthetic, subtle gradients. No text in the image.`;
}

return [{
  json: {
    ...data,
    imagePrompt
  }
}];

const https = require("https");
const inputData = $input.first().json;

const candidates = inputData.candidates || [];
const parts = candidates[0]?.content?.parts || [];
const imagePart = parts.find(p => p.inlineData);

const title = $("Image Prompt Builder").first().json.title || "blog-image";
const originalData = $("Image Prompt Builder").first().json;

if (!imagePart) {
  return [{ json: { ...originalData, imageUrl: null, imageError: "No image in Gemini response" } }];
}

const base64Data = imagePart.inlineData.data;
const mimeType = imagePart.inlineData.mimeType || "image/png";
const ext = mimeType.includes("jpeg") ? "jpg" : "png";
const slug = title.toLowerCase().replace(/[^a-z0-9]+/g, "-").slice(0, 50);
const filename = `${slug}-${Date.now()}.${ext}`;

const imageBuffer = Buffer.from(base64Data, "base64");

const supabaseUrl = $env.SUPABASE_URL;
const supabaseKey = $env.SUPABASE_SERVICE_KEY;
const hostname = supabaseUrl.replace("https://", "");

const uploadResult = await new Promise((resolve, reject) => {
  const options = {
    hostname,
    path: `/storage/v1/object/blog-images/${filename}`,
    method: "POST",
    headers: {
      "apikey": supabaseKey,
      "Authorization": "Bearer " + supabaseKey,
      "Content-Type": mimeType,
      "Content-Length": imageBuffer.length
    }
  };

  const req = https.request(options, (res) => {
    let body = "";
    res.on("data", chunk => body += chunk);
    res.on("end", () => resolve({ statusCode: res.statusCode, body }));
  });
  req.on("error", reject);
  req.write(imageBuffer);
  req.end();
});

const publicUrl = `${supabaseUrl}/storage/v1/object/public/blog-images/${filename}`;

return [{
  json: {
    ...originalData,
    imageUrl: publicUrl,
    imageFilename: filename,
    uploadStatus: uploadResult.statusCode
  }
}];

const items = $input.all();
const body = items[0].json.body || items[0].json;
return [{ json: body }];

